INSERT INTO `faq` (`id`, `category_faq_id`, `title`, `details`, `type`, `created_at`, `updated_at`) VALUES
(1, NULL, 'Apa itu Archiloka?', '<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Archiloka adalah sebuah marketplace arsitektural dan interior untuk kontraktor, arsitek, desainer, produsen ataupun toko material pertama di Indonesia. Platform ini digunakan untuk menampilkan karya dan produk perusahaan atau profesional di bidang arsitektural dan interior, serta menawarkan barang dan jasa untuk mudah dipesan oleh para calon klien dari berbagai daerah.&nbsp;</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Calon klien juga dapat mendaftarkan proyeknya untuk mendapatkan penawaran-penawaran dari berbagai perusahaan dan profesional. Penawaran terbaik yang menjadi pemenang proyek ditentukan oleh calon klien. Pemenang akan mendapatkan dana dari calon klien untuk mengerjakan proyek tersebut.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', 1, '2023-03-27 17:14:25', '2023-03-27 17:14:25'),
(2, NULL, 'Siapa yang dapat berjualan Archiloka?\r\n', '<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Perusahaan dan profesional di bidang arsitektur dan interior yang memiliki portofolio project / products, memiliki kantor, memiliki tim, dan berbadan hukum PT/CV dapat berjualan di Archiloka.</span></span></span></p>\r\n', 1, '2023-03-27 17:14:25', '2023-03-27 17:14:25'),
(3, NULL, 'Bagaimana cara agar bisa berjualan di Archiloka?\r\n', '<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Untuk bergabung sebagai perusahaan &amp; profesional di Archiloka, Anda harus memenuhi syarat sebagai perusahaan &amp; profesional di bidang arsitektur dan interior yang memiliki portofolio proyek atau produk, memiliki kantor, dan memiliki tim. Anda juga harus memiliki badan hukum PT/CV dan dapat menampilkan video, foto, dan karya Anda di platform.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Langkah-langkah untuk bergabung sebagai perusahaan &amp; profesional di Archiloka adalah sebagai berikut:</span></span></span></p>\r\n\r\n<ul>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Kunjungi website atau buka Aplikasi Archiloka</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Klik menu &quot;Masuk&quot;&nbsp;</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pilih opsi &quot;perusahaan &amp; profesional&quot; di halaman masuk</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Klik tombol &ldquo;masuk&rdquo;</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Isi formulir pendaftaran yang disediakan, termasuk informasi perusahaan Anda</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tambahkan Portofolio, Foto kantor dan Foto Tim Anda</span></span></span></li>\r\n</ul>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Selanjutnya Archiloka akan melakukan verifikasi data Anda. Setelah diverifikasi, Anda akan dapat mengunggah produk atau jasa Anda ke platform dan mulai berjualan di Archiloka</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 1, '2023-03-27 17:16:50', '2023-03-27 17:16:50'),
(4, NULL, 'Apa yang di maksud member platinum?', '<p><span style=\"font-size:11pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Member platinum adalah status keanggotaan level tertinggi yang tersedia di platform Archiloka yang terverifikasi memiliki pengalaman yang teruji dan kompetensi yang diakui di bidang arsitektural dan interior. Hal ini memudahkan klien untuk menemukan vendor yang tepat dan meminimalisir risiko kerugian akibat kerja sama dengan vendor yang kurang berkualitas. Selain itu, vendor platinum juga memiliki akses untuk menjual barang dan jasa serta mengajukan penawaran untuk berbagai proyek yang tersedia di Archiloka. Sebagai member platinum, Anda akan menjadi koordinator wilayah di satu kabupaten/kota dan akan memperoleh keuntungan sebesar 1% dari omzet transaksi yang tercatat di Archiloka di kabupaten/kota tersebut.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tugas dan tanggung jawab member platinum termasuk membantu supervisi secara online jika terdapat perselisihan klien dengan perusahaan/profesional di kabupaten/kota dimana Anda menjadi koordinator wilayah, serta mengajak kontraktor, arsitek, desainer, produsen, atau toko material untuk bergabung di Archiloka dan berkomunitas bersama Archiloka. Status keanggotaan platinum ini diberikan secara gratis oleh Archiloka kepada anggota yang memenuhi syarat tertentu.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', 1, '2023-03-27 17:16:50', '2023-03-27 17:16:50'),
(5, NULL, 'Apa yang dimaksud member premium?', '<p><span style=\"font-size:11pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Member premium adalah status keanggotaan yang yang dibawahi oleh memper platinum. Member premium tersedia di platform Archiloka yang terverifikasi memiliki pengalaman yang teruji dan kompetensi yang diakui di bidang arsitektural dan interior. Hal ini memudahkan klien untuk menemukan vendor yang tepat dan meminimalisir risiko kerugian akibat kerja sama dengan vendor yang kurang berkualitas. Selain itu, vendor premium juga memiliki akses untuk menjual barang dan jasa serta mengajukan penawaran untuk berbagai proyek yang tersedia di Archiloka.</span></span></span></p>\r\n', 1, '2023-03-27 17:19:07', '2023-03-27 17:19:07'),
(6, NULL, 'Siapa saja dapat memesan barang dan jasa di Archiloka? \r\n', '<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pemilik proyek yang membutuhkan kontraktor, arsitek, desainer, atau material. Selain itu, individu atau perusahaan yang memerlukan barang dan jasa di bidang arsitektural dan interior juga dapat memesan melalui platform Archiloka. </span></span></span></p>\r\n', 1, '2023-03-27 17:19:07', '2023-03-27 17:19:07'),
(7, NULL, 'Bagaimana cara memesan barang dan jasa di Archiloka?\r\n', '<ul>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Daftar atau masuk ke akun Archiloka Anda</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Lengkapi Alamat Anda</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Cari produk atau jasa yang ingin Anda pesan menggunakan fitur pencarian atau dengan menjelajahi kategori yang tersedia</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Setelah menemukan produk atau jasa yang sesuai, klik tombol &quot;Beli&quot; atau &quot;Pesan&quot;</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pilih metode pembayaran&nbsp;</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Setelah selesai, klik tombol &quot; Pesanan&quot; atau &quot;Beli Sekarang&quot; untuk menyelesaikan pembelian Anda</span></span></span></li>\r\n</ul>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Setelah pembelian berhasil dilakukan, perusahaan &amp; profesional yang menerima pesanan akan segera menghubungi Anda untuk mengatur detail lebih lanjut, seperti jadwal pengiriman atau proses pengerjaan.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', 1, '2023-03-27 17:20:12', '2023-03-27 17:20:12'),
(8, NULL, 'Apa saja yang dapat ditawarkan atau dijual di Archiloka?\r\n', '<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Di Archiloka, perusahaan dan profesional dapat menawarkan jasa dan produk arsitektural dan interior, dan calon klien dapat mencari kontraktor, arsitek, desainer, dan material untuk memesan jasa, membeli atau menyewa barang dan material.</span></span></span></p>\r\n', 1, '2023-03-27 17:20:12', '2023-03-27 17:20:12'),
(9, NULL, 'Apakah harga ditentukan oleh Archiloka?\r\n', '<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Harga jasa dan barang yang ditawarkan di Archiloka ditentukan oleh masing-masing perusahaan dan profesional. Archiloka tidak menentukan atau mematok harga.Namun, jika ada harga yang tidak wajar, Anda dapat melaporkannya dan akan ditindaklanjuti oleh Archiloka</span></span></span></p>\r\n', 1, '2023-03-27 17:23:29', '2023-03-27 17:23:29'),
(10, NULL, 'Bagaimana skema pembayaran di Archiloka?', '<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pembayaran dapat dilakukan dengan cara yang fleksibel, baik itu 100% di depan atau dengan termin yang besarannya dan jangka waktunya ditentukan oleh perusahaan &amp; profesional. Klien dapat tawar menawar dengan perusahaan dan profesional di Archiloka.&nbsp;</span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pembayaran yang dilakukan oleh klien langsung diteruskan ke dompet Anda di Archiloka sesuai tenggat waktu yang disepakati antara Anda sebagai perusahaan atau profesional dengan klien. Selanjutnya Anda dapat melakukan penarikan saldo dompet Anda ke rekening perbankan yang Anda miliki</span></span></span></p>\r\n', 1, '2023-03-27 17:23:29', '2023-03-27 17:23:29'),
(11, NULL, 'Apa keuntungan dari diskusi dan negosiasi dengan klien di Archiloka?', '<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Melalui fitur diskusi dan negosiasi yang disediakan di Archiloka, Anda dapat memperoleh kesepakatan terbaik dengan klien. Anda dapat membahas detail proyek, mengajukan penawaran yang sesuai dengan kebutuhan klien, serta mendapatkan masukan dan feedback dari klien untuk meningkatkan kualitas barang dan jasa Anda.</span></span></span></p>\r\n', 1, '2023-03-27 17:24:38', '2023-03-27 17:24:38'),
(12, NULL, 'Apakah Archiloka menyediakan dokumen-dokumen seperti RAB, MOU, dan progress pekerjaan?', '<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Perusahaan &amp; profesional dapat mengirimkan dokumen-dokumen tersebut kepada kliennya yang memesan/membeli jasa/barang di Archiloka dengan menggunakan fitur yang tersedia di platform</span></span></span></p>\r\n', 1, '2023-03-27 17:24:38', '2023-03-27 17:24:38'),
(13, NULL, 'Apa itu RAB?\r\n', 'RAB adalah singkatan dari Rencana Anggaran Biaya. RAB merupakan suatu dokumen yang berisi rencana atau perkiraan biaya yang dibutuhkan dalam suatu proyek.', 1, '2023-03-27 17:25:11', '2023-03-27 17:25:11'),
(14, NULL, 'Apa itu MOU?', 'MOU adalah singkatan dari Memorandum of Understanding. MOU adalah perjanjian tertulis antara dua pihak yang memuat kesepakatan-kesepakatan yang akan dilakukan dalam suatu proyek atau kerja sama.', 1, '2023-03-27 17:25:11', '2023-03-27 17:25:11'),
(15, NULL, 'Apa itu progress pekerjaan?', '<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Progress pekerjaan adalah dokumen yang berisi laporan mengenai perkembangan suatu proyek atau pekerjaan yang dilakukan oleh perusahaan dan profesional yang terlibat dalam proyek tersebut. Dokumen ini berisi informasi tentang aktivitas yang telah dilakukan, waktu yang diperlukan untuk menyelesaikan setiap aktivitas, dan seberapa jauh pekerjaan telah dilakukan.</span></span></span></p>\r\n', 1, '2023-03-27 17:28:42', '2023-03-27 17:28:42'),
(16, NULL, 'Bagaimana cara mendapatkan proyek di Archiloka?\r\n', 'Pemilik proyek dapat mendaftarkan proyeknya di Archiloka untuk mendapatkan penawaran dari perusahaan & profesional, dan pemenangnya adalah penawaran terbaik yang ditentukan pemilik proyek. Pemenang mendapatkan proyek tersebut untuk diselesaikan.\r\n', 1, '2023-03-27 17:28:42', '2023-03-27 17:28:42'),
(17, NULL, 'Apakah Archiloka mengenakan biaya administrasi?\r\n', 'Ya, Archiloka mengenakan biaya administrasi sebesar 5% dari total penjualan/kontrak yang didapat untuk membiayai operasional dan menyelenggarakan pelatihan berkala untuk perusahaan dan profesional.', 1, '2023-03-27 17:29:14', '2023-03-27 17:29:14'),
(18, NULL, 'Bagaimana cara menarik saldo di Archiloka?\r\n', 'Untuk menarik saldo, pertama-tama klik menu “withdraw” pada halaman profil Anda. Setelah itu, masukkan data rekening Anda dan jumlah saldo yang ingin ditarik, lalu klik tombol \"withdraw\".\r\n', 1, '2023-03-27 17:29:14', '2023-03-27 17:29:14'),
(19, NULL, 'Bagaimana cara melihat transaksi saya?\r\n', 'Untuk melihat transaksi yang sudah dilakukan, klik menu \"saldo\" pada halaman profil Anda. Di sana, Anda dapat melihat riwayat transaksi yang telah dilakukan.', 1, '2023-03-27 17:29:45', '2023-03-27 17:29:45'),
(20, NULL, 'Bagaimana jika terjadi konflik antara Perusahaan & Profesional dengan klien pemilik proyek di Archiloka?\r\n', 'Archiloka menyediakan layanan pendampingan dan penyelesaian konflik yang dapat membantu Anda menjaga hubungan baik dengan klien. Jika terdapat masalah atau keluhan dari klien, Archiloka akan membantu Anda mencari solusi terbaik agar masalah tersebut dapat diselesaikan dengan baik.', 1, '2023-03-27 17:29:45', '2023-03-27 17:29:45');
