(12, 200, 51, 'SPESIFIKASI LENGKAP', '<p>1 Unit Rumah :</p><p>LT 80 m²</p><p>LB 76 m²</p><p>2 Lantai</p><p>3 Kamar Tidur</p><p>2 Kamar Mandi</p><p>1 Ruang Makan</p><p>1 Ruang Keluarga</p><p>2 Carport</p><p>Balkon</p><p><br></p><p>Keunggulan Lokasi:</p><p>20 menit 8 km UGM,UPN,UII</p><p>15 menit 6 km Titik Nol Jogja Malioboro</p><p>5 menit 4 km kampus Terpadu UAD Ringroad</p><p>5 menit RSUD WIROSABAN KOTA JOGJA</p><p>5 menit RSI HIDAYATULLAH</p><p>Dekat TK,SD,SMP BIAS</p><p>Dekat sekolah Min 1</p><p>Dekat jalan nitikan</p><p>Dekat Terminal Giwangan</p><p>Dekat Superindo XT Square</p><p>Dekat Bank BRI GIwangan</p><p>Dekat Mie Ayam Tumini, Sate Pak Pong</p><p>Dekat SMA N 10, SMA N 9 YOgyakarta</p><p><br></p><p>SERTIFIKAT SHM, RUMAH INDEN 6 BULAN, LOKASI STRATEGIS, DEKAT PUSAT KOTA JOGJA.</p>', NULL, NULL, 1669869073, '127.0.0.1', 1669869127, '127.0.0.1'),
(13, 202, 51, 'Detail', '<p>SPESIFIKASI LENGKAP</p><p><br></p><p>Dijual Rumah baru siap huni dalam cluster dikawasan Pejaten Barat, Jakarta Selatan</p><p>Type A</p><p>Bangunan 3 lantai</p><p>Luas tanah 276 meter</p><p>Luas bangunan 330 meter</p><p>KT 4+1 KM</p><p>4+1 Service area</p><p>Garasi + carport</p><p>Ruang tamu &amp; keluarga&nbsp;</p><p>Taman belakang&nbsp;</p><p>SHM / IMB / PBB&nbsp;</p><p><br></p>', NULL, NULL, 1669871524, '127.0.0.1', 0, ''),
(14, 204, 51, 'Detail', '<p>SPESIFIKASI LENGKAP</p><p><br></p><p>Rumah di Kemang</p><p>Halaman Utama</p><p>LT : 600m²</p><p>LB :450m²</p><p>K.mandi : 4</p><p>K. Tidur : 5+2</p><p>Ruangan/gudang </p><p>Ruangan kantor </p><p>Listrik : 16,000watt</p><p>Air </p><p>Sertifikat : SHM</p><p>Hadap : Timur </p><p><br></p><p>Note:  </p><p>Kolam Renang</p><p>Lounge Area</p><p><br></p>', NULL, NULL, 1669871997, '127.0.0.1', 0, ''),
(15, 205, 51, 'Detail', '<p>SPESIFIKASI LENGKAP</p><p><br></p><p>CIRACAS GREEN VIEW </p><p>Mengusung konsep perumahan Compact Home dengan fasilitas modern Smart Home Sistem yang memudahkan Anda mengontrol rumah dari jarak jauh secara otomatis dari mana saja dan kapan saja seperti Smart Door Lock Alarm Sistem Automatic Light Sensor Motion Lokasi STRATEGIS di Jakarta Timur yang jauh dari kebisingan ibukota serta suasana yang Sejuk dan Asri di perumahan Ciracas Green View bisa Anda nikmati dengan survey langsung lokasi.</p><p><br></p><p>KT 3</p><p>KM 2</p><p>Bangunan 50 MTR</p><p>Lahan 62 MTR </p><p><br></p><p>Lokasi Terdekat : </p><p>50 Mtr ke Masjid Jami\' </p><p>1.4 KM ke Stasiun LRT </p><p>5 KM ke Terminal Kp. Rambutan </p><p>7.7 KM ke Gerbang Tol Pasar Rebo </p><p>8.3 KM ke Gerbang Tol Jagorawi </p><p>1.5 KM ke Jakarta Islamic School </p><p>3.1 KM ke RSUD Ciracas </p><p>16 KM ke Bandara Halim Perdana Kusuma </p><p>5.7 KM ke Mall Cijantung Saat ini Ciracas Green View </p>', NULL, NULL, 1669872544, '127.0.0.1', 0, ''),
(16, 206, 51, 'Detail', '<p>SPESIFIKASI LENGKAP</p><p><br></p><p>Dibuka Kembali Perumahan Kecil Kecil dengan bangunan 2  lantai di Lokasi yang cukup strategis daerah Cipinang kebembem kec pulogadung kota Jakarta Timur.  Tampilan rumah mewah dan elegant juga baru. Ada pun spesifikasi rumah sebagai berikut :</p><p><br></p><p>Luas tanah bervariasi Mulai : 35  m2 sampai 81 m2</p><p>Luas bangunan 2 lantai         : 69 m2 sampai 88 m2</p><p><br></p><p>Dimensi tanah: </p><p>Lebar 3.5 m x 10 ( luas 35 m2 )</p><p>Lebar 5.32n x 8.47 ( Luas 45 m2 )</p><p>dst</p><p><br></p><p>Lay out :</p><p>Lantai 1 : Ruang tamu, Dapur, Kamar mandi, Ruang cuci jemur</p><p>Lantai 2 : Kamar tidur 2 unit dan kamar mandi 2unit, balkon</p><p><br></p><p>Rumah indent yabisa rubah tata letak ruangan jika lay out dari kami tidak sreg.</p><p><br></p><p><br></p><p><br></p><p>legalitas : SHM dan IMB</p>', NULL, NULL, 1669873147, '127.0.0.1', 0, ''),
(17, 207, 51, 'Detail', '<p>SPESIFIKASI LENGKAP </p><p><br></p><p>L tanah   : 60m² ,92m² ,100m²</p><p>Lebar muka     : 8 m</p><p>L bangunan     : 36 m²</p><p>Kamar tidur     : 2</p><p>Kamar mandi  : 1</p><p>R tamu</p><p>R keluarga</p><p>Dapur</p><p>Carpot </p><p>Taman</p><p>Listrik   : 1300 watt</p><p>Air bor  : 26 - 30 m</p><p><br></p><p>Shm - imb</p><p><br></p><p>Tersedia type 36,45,70</p><p><br></p><p>Fasilitas :</p><p>- Jalan paving blok 1 akses ( aman )</p><p>- Dekat masjid</p><p>- Dekat Griya, alfamart, indomart, borma</p><p>- Dekat Rs hermina </p><p>- Dekat Sekolah favorit</p><p>- Dekat Polsek</p><p>- Dekat sport Center</p><p><br></p><p><br></p><p><br></p><p><br></p>', NULL, NULL, 1669874964, '127.0.0.1', 0, ''),
(18, 208, 51, 'Detail', '<p>SPESIFIKASI LENGKAP</p><p><br></p><p>Rumah di Lebak Bulus</p><p>Halaman Utama  Jakarta  Jakarta Selatan  Lebak Bulus  </p><p><br></p><p>CLUSTER CITRA INDAH 2</p><p><br></p><p>- BEBAS BANJIR</p><p>- FREE BIAYA NOTARIS</p><p>- FREE BPHTB (KPR)</p><p>- FREE BIAYA ASURANSI (KPR)</p><p>- FREE BIAYA SP3K (KPR)</p><p>- FREE BIAYA PEMBUATAN SHM</p><p>- FREE KANOPI</p><p><br></p><p>Sale Point :</p><p>- 15 Menit Ke Exit Tol Desari Sawangan</p><p>- 10 Menit Ke Stasiun KRL Citayam</p><p>- 5   Menit Kolam Pasirputih</p><p>- 15 Menit RSUD Depok</p><p><br></p><p>Spesifikasi :</p><p>- Pondasi : Batu kali</p><p>- Struktur : Beton bertulang</p><p>- Dinding : Hebel + plester + aci</p><p>- Lantai : Granit 60x60</p><p>- Atap : Baja ringan Genting M- Class</p><p>- Platform : Gypsun + Holo</p><p>- Kusen : Alumunium</p><p>- Air : Sumur bor + Jetpump + Toren</p><p>- Listrik : 1300 watt</p><p>- Tipe : Cluster</p><p>- Status : Ready/Indent custom</p><p>- Akses : 2 mobil</p><p>- Surat : SHM, AJB, PBB Lengkap</p><p>- Fasilitas Cluster : Wifi, Musholah, Taman, Pos Security, CCTV</p><p><br></p>', NULL, NULL, 1669878572, '127.0.0.1', 0, ''),
(20, 211, 53, 'Detail', '<p>Bangun dan Renovasi Rumah Mulai Dari Rp 70.000.000</p>', NULL, NULL, 1669879494, '127.0.0.1', 1669879662, '127.0.0.1'),
(21, 210, 51, 'Detail', '<p>SPESIFIKASI LENGKAP</p><p><br></p><p>Rumah Elite &amp; Mewah modern serta futuristik</p><p><br></p><p>Akses jalan masuk mobil dan ada Carport nya merupakan rumah bergaya eropah kini kami hadirkan Di Pisangan Baru dekat stasiun kereta jatinegara Jakarta timur dan hanya 150 meter dr jalan raya A.yani. Untuk Pembelian dua Unit sekaligus akan Mendapat kan Discount khusus.</p><p><br></p><p>Untuk Akses lokasi Pisangan baru jakarta timur ini:</p><p>*dekat ke mall jatinegara</p><p>* 5 menit ke stasiun kereta jatinegara </p><p>*Dekat ke pusat pasar jangkrik</p><p>*Dekat ke R.S Siloam</p><p>*Dekat Pintu Tol jatinegara</p><p>*Dekat ke arah pasar jatinegara</p><p>*Dekat ke arah jl.A Yani Spesikasi Teknis</p><p><br></p><p>Bahan Bagus dan Kuat :</p><p>1. Pondasi Ceker ayam di cor ( Kekuatannya untuk 3 Lantai )</p><p>2. Lantai Granite Ukuran 60 cm x 60 cm</p><p>3. Pintu Kayu</p><p>4. Jendela Alumunium Fowder Coating + Kaca</p><p>5. Plafond Hollow Gypsum</p><p>6. Listrik 2200 watt</p><p>7. Dudukan lampu Down light</p><p>8. Kamar Mandi ( Closset duduk american standard, Hexospen, Dinding setengah keramik tempel, Hexospen, Shower )</p><p>9. Tersedia Instalasi AC</p><p>10. tersedia Toren dan grondtank sebagai penampungan air</p><p>11. Air PDAM</p><p>12. Rangka Atap Baja ringan</p><p>13. Genteng Multi Roop Serah</p><p><br></p><p>Terima Kunci Sebentar lagi paling lama 8 bulan lg Rumah Cepat Terjual dalam 1-2 bulan Habis !</p><p>Cara Bayar : Cash Keras Cash Bertahap Belum bisa KPR ya kak !!</p><p><br></p><p>Legalitas : SHM IMB</p><p><br></p><p>Keterangan :</p><p>Ukuran LT 24</p><p>LB 28</p>', NULL, NULL, 1669879587, '127.0.0.1', 1669879625, '127.0.0.1'),
(22, 209, 53, 'Detail', '<p>Desain Interior Kamar Tidur </p>', NULL, NULL, 1669879841, '127.0.0.1', 0, ''),
(23, 212, 51, 'Detail', '<p><br></p><p>Spesifikasi </p><p><br></p><p>Perum Citraland Utara </p><p>dekat North West </p><p>Cluster Bukit Palma e3 </p><p>Lt 8x15 </p><p>Lb 103</p><p>Carport 2mobil</p><p>Depan 3 mobil bs lewat</p><p>Dkt Sekolah Tk Sd Smp Smu</p><p>CITRA BERKAT ( CIPUTRA )</p><p>dkt freshmarket Tpr Citraland </p><p>dkt Rs BDH</p><p>dkt Univ Ciputra</p><p>10mnt Mall Pakuwon </p><p>dkt  JLLB 55m</p>', NULL, NULL, 1669880258, '127.0.0.1', 0, ''),
