(28, 217, 51, 'Detail', '<p>Deskripsi</p><p><br></p><p>-Merek: Deli</p><p>-Bahan: Baja 45# -Ukuran: 16 x 10,1 x 2,5 cm</p><p>-Berat: 360 gram</p><p>-Diameter palu: 26 mm</p><p><br></p><p>Kegunaan:</p><p>✔️Memaku dan melepaskan paku pada sesuatu</p><p><br></p><p>- Kepala palu terbuat dari Carbon steel berkualitas tinggi</p><p>- Kepala dan pegangan palu tidak mudah lepas</p><p>- Pegangan fiberglass yang nyaman digunakan</p>', NULL, NULL, 1671088056, '127.0.0.1', 0, ''),
