(65, 275, 51, 'Room Amenities', '<p>DELUXE ROOM DENGAN LUAS 28M2</p><p>Semua kamar memberikan sensasi kemewahan dengan kamar mandi dalam, minibar, akses internet kecepatan tinggi, smart TV, dan pemandangan sawah yang mengagumkan atau pemandangan ke kolam renang dan cakrawala kota Majalengka. Setiap tamu dipastikan mendapatkan pengalaman menginap yang nyaman.</p><p>KARTU KUNCI PINTU ELEKTRONIK</p><p>SELF-CODED SAFE</p><p>TV KABEL</p><p>PENGERING RAMBUT</p><p>ALAT PEMBUAT TEH DAN KOPI</p><p>MINI BAR</p><p>FASILITAS TELPON IDD DENGAN VOICEMAIL</p><p>AIR CONDITIONING</p><p>KAMAR MANDI DALAM DENGAN SEMUA PERLENGKAPAN MANDI</p><p>PANCURAN AIR PANAS DAN DINGIN</p>', NULL, NULL, 1675493997, '127.0.0.1', 0, ''),
(66, 275, 51, 'Guest Services', '<p>Kami menawarkan berbagai pelayanan dan kelengkapan untuk memastikan pengalaman menginap yang nyaman dan merelaksasi.</p><p><br></p><p>ROOM SERVICE 24 JAM</p><p>PARKIR LUAS DAN SATPAM SELAMA 24 JAM</p><p>RUANG PERTEMUAN</p><p>PUSAT KEBUGARAN</p><p>KOLAM RENANG</p><p>LOUNGE, BAR DAN RESTORAN YANG OTENTIK</p><p>KONEKSI INTERNET DI DALAM KAWASAN HOTEL</p><p>LAUNDRY DAN DRY CLEANING</p><p>PENJEMPUTAN DARI/KE BANDARA</p><p>PARKIR MOBIL GRATIS</p>', NULL, NULL, 1675494089, '127.0.0.1', 0, ''),
(67, 276, 51, 'Room Amenities', '<p>DELUXE EXECUTIVE ROOMS SIZE 28SQM</p><p>All rooms are luxuriously designed, with en-suite bathroom and equipped with minibar, complimentary high speed internet access, smart TV, and offer sensational views of paddy field or our expansive swimming pool and the city skyline, to ensure the best comfortable stay for all our guests.</p><p>ELECTRONIC KEY CARDS</p><p>SELF-CODED SAFE</p><p>CABLE TV</p><p>HAIRDRYER</p><p>COFFEE AND TEA MAKING FACILITIES</p><p><br></p>', NULL, NULL, 1675494831, '127.0.0.1', 0, ''),
